import { Stack, Box } from "@mui/system"
import { Button } from "@mui/material"
import { useState } from "react"

function Login(){

    const [username, setUsername] = useState('')
    const [userid, setUserID] = useState('')
    const [password, setPassword] = useState('')

    return (
        <Box sx={{ p:20}}>
            Login
            <h2>Username</h2>
            <TextField value={quantity === 0 ? '' : input} type="string" id="outlined-basic" label="Enter Username" variant="outlined" onChange={(e) =>{
                setUsername(e.target.value)
            }}/>
            <h2>User ID</h2>
            <TextField value={quantity === 0 ? '' : input} type="string" id="outlined-basic" label="Enter User ID" variant="outlined" onChange={(e) =>{
                setUserID(e.target.value)
            }}/>
            <h2>Password</h2>
            <TextField value={quantity === 0 ? '' : input} type="string" id="outlined-basic" label="Enter Password" variant="outlined" onChange={(e) =>{
                setPassword(e.target.value)
            }}/>
        </Box>
    )
}

export default Login
